  false,\n\t\"url\": null,\n\t\"notes\": \"The hyperspectral surveys were conducted
  using a hyperspectral radiometer encased in a custom-made underwater housing. The
  NOWRAMP expedition represents the first time an un-tethered underwater spectroradiometer
  was used in coral reef ecosystems. From the readings, one derives substrate reflectance,
  which can be directly compared to remotely sensed images. Readings were collected
  from the most common substrates including corals, algae, sand, rubble and pavement.
  Several hundred spectral readings were collected during the 2001 NWHI field campaigns.\",\n\t\"owner_org\":
